  templateUrl: './register.component.html',
  styleUrls: ['./register.component.scss'],
})
export class RegisterComponent implements OnExit {
  constructor() {}

  onExit() {
    const rta = confirm('Logica desde compo, estas seguro salir?');
    return rta;
  }
}
